var oldCourse = this.Get<decimal>("UsrOldCourse");

var newCourse = this.Get<decimal>("UsrNewCourse");

decimal result = 0;

if (oldCourse > newCourse) {
	result = 100 - (100 * newCourse / oldCourse);
} else if (newCourse > oldCourse) {
	result = 100 - (100 * oldCourse / newCourse);
}

if (result > 5) {
	this.Set("UsrIsCourseChanged", true);
}

return true;

var courseId = this.Get<Guid>("UsrCollectedCourseType");

var currencyId = this.Get<Guid>("UsrCollectedCurrency");

var date = this.Get<DateTime>("UsrCollectedDate");

var query = new Select (UserConnection)
	.Column(nameof(UsrCurrencyQuotations.Id))
	.From(nameof(UsrCurrencyQuotations))
	.Where(nameof(UsrCurrencyQuotations.UsrCourseTypeId)).IsEqual(Column.Const(courseId))
	.And(nameof(UsrCurrencyQuotations.UsrCurrencyId)).IsEqual(Column.Const(currencyId))
	.And(Func.Day(nameof(UsrCurrencyQuotations.UsrQuotationDate))).IsEqual(Column.Const(date.Day))
	.And(Func.Month(nameof(UsrCurrencyQuotations.UsrQuotationDate))).IsEqual(Column.Const(date.Month))
	.And(Func.Year(nameof(UsrCurrencyQuotations.UsrQuotationDate))).IsEqual(Column.Const(date.Year))
as Select;

query.SpecifyNoLockHints();

using (DBExecutor dbExecutor = UserConnection.EnsureDBConnection())
{
	using (System.Data.IDataReader dataReader = query.ExecuteReader(dbExecutor))
	{
		if (dataReader.Read())
		{
			Guid id = dataReader.GetColumnValue<Guid>(nameof(UsrCurrencyQuotations.Id));
			this.Set("UsrFindedQuotationId", id);
		}
	}
}

return true;

var messageType = this.Get<string>("UsrIsQuotationFindedMessage");

var oldCourse = this.Get<decimal>("UsrOldCourse");

var newCourse = this.Get<decimal>("UsrNewCourse");

var createdCourse = this.Get<decimal>("UsrCreatedQuotationCourse");

var currencyId = this.Get<Guid>("UsrCollectedCurrency").ToString();

string currencyName = "";

var entitySchemaManager = UserConnection.GetSchemaManager("EntitySchemaManager") as EntitySchemaManager;
var entitySchemaQuery = new EntitySchemaQuery(entitySchemaManager, "Currency");
entitySchemaQuery.Filters.Add(
    entitySchemaQuery.CreateFilterWithParameters(
    FilterComparisonType.Equal,
    "Id",
    currencyId
));

entitySchemaQuery.AddColumn("Name");
entitySchemaQuery.RowCount = 1;
var checkCollection = entitySchemaQuery.GetEntityCollection(UserConnection);
if (checkCollection.Count > 0)
{
    currencyName = checkCollection[0].GetTypedColumnValue<string>("Name");
}

string message = "";

if (messageType == "добавление")
{
    message = "Требуется подтверждение на " + messageType + " валюты " + currencyName + ". Значение: " + createdCourse;
}
else if (messageType == "изменение")
{
    message = "Требуется подтверждение на " + messageType + " валюты " + currencyName + ". Предыдущее  начение: " + oldCourse + ". Новое значение: " + newCourse;
} else
{
	message = "Требуется подтверждение котировки";
}

this.Set("UsrVerifyMessage", message);

return true;
